class DrugModel {
    tradeName: string;
    genericName: string;
    containers: string;
    dosageForm: string;
    cate

    constructor(tradeName: string, genericName: string, containers: string, dosageForm: string) {
        this.tradeName = tradeName;
        this.genericName = genericName;
        this.containers = containers;
        this.dosageForm = dosageForm;
    }
}

export default DrugModel;
